import React, { Component } from 'react';
import '../ContentItemPage/ContentItemPage.css';
import { Container, Row, Col } from 'react-bootstrap';

import {Box} from '../Box/Box.js';

const ContentItemPage = () => {
    return(
        <>
        <Row>
            <Col>
                <Box />
            </Col>
            <Col>
                <Box>Body</Box>
            </Col>
        </Row>
        <br></br>
        <br></br>
        <Row>
            <Box />
        </Row>
        </>
    );
}


export default ContentItemPage;
